import React from 'react';
import imgTable from '../assets/cycles_status_table.JPG';
import { Table } from 'semantic-ui-react'
import './CycleTable.css';
import Loader from '../reusableComponents/Loader';


const cycle_title="CHAZ_UFS_Swift_HW_HUAWEI_ShenzhenJL_FW_30b.1058.35235_CTF44_SDR4.4U_1.6.0014.34721_CTF4U_1.5.0007.33788_VLD_1.0.35105";

const CycleTable=(props)=>{

    let view=null;
    let rows= props.data.map((row)=>{return(
        <Table.Row key={row.ID}>
            <Table.Cell>{row.ID}</Table.Cell>
            <Table.Cell>{row.Description}</Table.Cell>
            <Table.Cell>{row.Ex_Running}</Table.Cell>
            <Table.Cell>{row.Ex_Pending}</Table.Cell>
            <Table.Cell>{row.Ex_Completed}</Table.Cell>
        </Table.Row>)
    });

    if (props.data.length>0)
    {

        view = <Table fixed>
            <Table.Header>
                <Table.Row>
                    <Table.HeaderCell>Cycle_Id</Table.HeaderCell>
                    <Table.HeaderCell>Cycle Name</Table.HeaderCell>
                    <Table.HeaderCell>Running Executions</Table.HeaderCell>
                    <Table.HeaderCell>Pending Executions</Table.HeaderCell>
                    <Table.HeaderCell>Completed Pass</Table.HeaderCell>
                </Table.Row>
            </Table.Header>

            <Table.Body>
                <Table.Row>
                    {rows}
                </Table.Row>
            </Table.Body>
            <Table.Footer>
                <Table.Row>
                    <Table.Cell>0</Table.Cell>
                    <Table.Cell>1</Table.Cell>
                    <Table.Cell>2</Table.Cell>
                    <Table.Cell>2</Table.Cell>
                    <Table.Cell>2</Table.Cell>
                </Table.Row>
            </Table.Footer>
        </Table>

    }
    else{
        view=<Loader/>
    }
    return(
        <div >
            <div >
                {view}
            </div>
        </div>
    )
}

export default CycleTable;
